          "message": "chore(deps): update pnpm to v10.17.0 (#1752)\n\nComing soon: The Renovate bot (GitHub App) will be renamed to Mend. PRs\nfrom Renovate will soon appear from 'Mend'. Learn more\n[here](https://redirect.github.com/renovatebot/renovate/discussions/37842).\n\nThis PR contains the following updates:\n\n| Package | Change | Age | Confidence |\n|---|---|---|---|\n| [pnpm](https://pnpm.io)\n([source](https://redirect.github.com/pnpm/pnpm/tree/HEAD/pnpm)) |\n[`10.16.1+sha512.0e155aa2629db8672b49e8475da6226aa4bdea85fdcdfdc15350874946d4f3c91faaf64cbdc4a5d1ab8002f473d5c3fcedcd197989cf0390f9badd3c04678706`\n-> `10.17.0`](https://renovatebot.com/diffs/npm/pnpm/10.16.1/10.17.0) |\n[![age](https://developer.mend.io/api/mc/badges/age/npm/pnpm/10.17.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![confidence](https://developer.mend.io/api/mc/badges/confidence/npm/pnpm/10.16.1/10.17.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n\n---\n\n### Release Notes\n\n<details>\n<summary>pnpm/pnpm (pnpm)</summary>\n\n###\n[`v10.17.0`](https://redirect.github.com/pnpm/pnpm/blob/HEAD/pnpm/CHANGELOG.md#10170)\n\n[Compare\nSource](https://redirect.github.com/pnpm/pnpm/compare/v10.16.1...v10.17.0)\n\n##### Minor Changes\n\n- The `minimumReleaseAgeExclude` setting now supports patterns. For\ninstance:\n\n  ```yaml\n  minimumReleaseAge: 1440\n  minimumReleaseAgeExclude:\n    - \"@&#8203;eslint/*\"\n  ```\n\nRelated PR:\n[#&#8203;9984](https://redirect.github.com/pnpm/pnpm/pull/9984).\n\n##### Patch Changes\n\n- Don't ignore the `minimumReleaseAge` check, when the package is\nrequested by exact version and the packument is loaded from cache\n[#&#8203;9978](https://redirect.github.com/pnpm/pnpm/issues/9978).\n- When `minimumReleaseAge` is set and the active version under a\ndist-tag is not mature enough, do not downgrade to a prerelease version\nin case the original version wasn't a prerelease one\n[#&#8203;9979](https://redirect.github.com/pnpm/pnpm/issues/9979).\n\n</details>\n\n---\n\n### Configuration\n\n📅 **Schedule**: Branch creation - At any time (no schedule defined),\nAutomerge - At any time (no schedule defined).\n\n🚦 **Automerge**: Enabled.\n\n♻ **Rebasing**: Whenever PR is behind base branch, or you tick the\nrebase/retry checkbox.\n\n🔕 **Ignore**: Close this PR and you won't be reminded about this update\nagain.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/textlint/textlint).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiI0MS45Ny4xMCIsInVwZGF0ZWRJblZlciI6IjQxLjk3LjEwIiwidGFyZ2V0QnJhbmNoIjoibWFzdGVyIiwibGFiZWxzIjpbImRlcGVuZGVuY2llcyJdfQ==-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
