          "message": "chore(deps): update patch updates (patch) (#1784)\n\nThis PR contains the following updates:\n\n| Package | Change | Age | Confidence |\n|---|---|---|---|\n|\n[@types/node](https://redirect.github.com/DefinitelyTyped/DefinitelyTyped/tree/master/types/node)\n([source](https://redirect.github.com/DefinitelyTyped/DefinitelyTyped/tree/HEAD/types/node))\n| [`^24.6.2` ->\n`^24.7.0`](https://renovatebot.com/diffs/npm/@types%2fnode/24.7.0/24.7.0)\n|\n[![age](https://developer.mend.io/api/mc/badges/age/npm/@types%2fnode/24.7.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![confidence](https://developer.mend.io/api/mc/badges/confidence/npm/@types%2fnode/24.7.0/24.7.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n| [pnpm](https://pnpm.io)\n([source](https://redirect.github.com/pnpm/pnpm/tree/HEAD/pnpm)) |\n[`10.18.0+sha512.e804f889f1cecc40d572db084eec3e4881739f8dec69c0ff10d2d1beff9a4e309383ba27b5b750059d7f4c149535b6cd0d2cb1ed3aeb739239a4284a68f40cfa`\n-> `10.18.1`](https://renovatebot.com/diffs/npm/pnpm/10.18.0/10.18.1) |\n[![age](https://developer.mend.io/api/mc/badges/age/npm/pnpm/10.18.1?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![confidence](https://developer.mend.io/api/mc/badges/confidence/npm/pnpm/10.18.0/10.18.1?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n\n---\n\n### Release Notes\n\n<details>\n<summary>pnpm/pnpm (pnpm)</summary>\n\n###\n[`v10.18.1`](https://redirect.github.com/pnpm/pnpm/blob/HEAD/pnpm/CHANGELOG.md#10181)\n\n[Compare\nSource](https://redirect.github.com/pnpm/pnpm/compare/v10.18.0...v10.18.1)\n\n##### Patch Changes\n\n- Don't print a warning, when `--lockfile-only` is used\n[#&#8203;8320](https://redirect.github.com/pnpm/pnpm/issues/8320).\n- `pnpm setup` creates a command shim to the pnpm executable. This is\nneeded to be able to run `pnpm self-update` on Windows\n[#&#8203;5700](https://redirect.github.com/pnpm/pnpm/issues/5700).\n- When using pnpm catalogs and running a normal `pnpm install`, pnpm\nproduced false positive warnings for \"*skip adding to the default\ncatalog because it already exists*\". This warning now only prints when\nusing `pnpm add --save-catalog` as originally intended.\n\n</details>\n\n---\n\n### Configuration\n\n📅 **Schedule**: Branch creation - At any time (no schedule defined),\nAutomerge - At any time (no schedule defined).\n\n🚦 **Automerge**: Enabled.\n\n♻ **Rebasing**: Whenever PR is behind base branch, or you tick the\nrebase/retry checkbox.\n\n👻 **Immortal**: This PR will be recreated if closed unmerged. Get\n[config\nhelp](https://redirect.github.com/renovatebot/renovate/discussions) if\nthat's undesired.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/textlint/textlint).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiI0MS4xNDMuMSIsInVwZGF0ZWRJblZlciI6IjQxLjE0My4xIiwidGFyZ2V0QnJhbmNoIjoibWFzdGVyIiwibGFiZWxzIjpbImRlcGVuZGVuY2llcyJdfQ==-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
