          "message": "chore(deps): update pnpm to v10.19.0 (#1805)\n\nThis PR contains the following updates:\n\n| Package | Change | Age | Confidence |\n|---|---|---|---|\n| [pnpm](https://pnpm.io)\n([source](https://redirect.github.com/pnpm/pnpm/tree/HEAD/pnpm)) |\n[`10.18.3+sha512.bbd16e6d7286fd7e01f6b3c0b3c932cda2965c06a908328f74663f10a9aea51f1129eea615134bf992831b009eabe167ecb7008b597f40ff9bc75946aadfb08d`\n-> `10.19.0`](https://renovatebot.com/diffs/npm/pnpm/10.18.3/10.19.0) |\n[![age](https://developer.mend.io/api/mc/badges/age/npm/pnpm/10.19.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![confidence](https://developer.mend.io/api/mc/badges/confidence/npm/pnpm/10.18.3/10.19.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n\n---\n\n### Release Notes\n\n<details>\n<summary>pnpm/pnpm (pnpm)</summary>\n\n###\n[`v10.19.0`](https://redirect.github.com/pnpm/pnpm/blob/HEAD/pnpm/CHANGELOG.md#10190)\n\n[Compare\nSource](https://redirect.github.com/pnpm/pnpm/compare/v10.18.3...v10.19.0)\n\n##### Minor Changes\n\n- You can now allow specific versions of dependencies to run postinstall\nscripts. `onlyBuiltDependencies` now accepts package names with lists of\ntrusted versions. For example:\n\n  ```yaml\n  onlyBuiltDependencies:\n    - nx@21.6.4 || 21.6.5\n    - esbuild@0.25.1\n  ```\n\nRelated PR:\n[#&#8203;10104](https://redirect.github.com/pnpm/pnpm/pull/10104).\n\n- Added support for exact versions in `minimumReleaseAgeExclude`\n[#&#8203;9985](https://redirect.github.com/pnpm/pnpm/issues/9985).\n\nYou can now list one or more specific versions that pnpm should allow to\ninstall, even if those versions don’t satisfy the maturity requirement\nset by `minimumReleaseAge`. For example:\n\n  ```yaml\n  minimumReleaseAge: 1440\n  minimumReleaseAgeExclude:\n    - nx@21.6.5\n    - webpack@4.47.0 || 5.102.1\n  ```\n\n</details>\n\n---\n\n### Configuration\n\n📅 **Schedule**: Branch creation - At any time (no schedule defined),\nAutomerge - At any time (no schedule defined).\n\n🚦 **Automerge**: Enabled.\n\n♻ **Rebasing**: Whenever PR is behind base branch, or you tick the\nrebase/retry checkbox.\n\n🔕 **Ignore**: Close this PR and you won't be reminded about this update\nagain.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/textlint/textlint).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiI0MS4xNTkuNCIsInVwZGF0ZWRJblZlciI6IjQxLjE1OS40IiwidGFyZ2V0QnJhbmNoIjoibWFzdGVyIiwibGFiZWxzIjpbImRlcGVuZGVuY2llcyJdfQ==-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
