          "message": "chore(deps): update pnpm to v10.20.0 (#1812)\n\nThis PR contains the following updates:\n\n| Package | Change | Age | Confidence |\n|---|---|---|---|\n| [pnpm](https://pnpm.io)\n([source](https://redirect.github.com/pnpm/pnpm/tree/HEAD/pnpm)) |\n[`10.19.0+sha512.c9fc7236e92adf5c8af42fd5bf1612df99c2ceb62f27047032f4720b33f8eacdde311865e91c411f2774f618d82f320808ecb51718bfa82c060c4ba7c76a32b8`\n-> `10.20.0`](https://renovatebot.com/diffs/npm/pnpm/10.19.0/10.20.0) |\n[![age](https://developer.mend.io/api/mc/badges/age/npm/pnpm/10.20.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n[![confidence](https://developer.mend.io/api/mc/badges/confidence/npm/pnpm/10.19.0/10.20.0?slim=true)](https://docs.renovatebot.com/merge-confidence/)\n|\n\n---\n\n### Release Notes\n\n<details>\n<summary>pnpm/pnpm (pnpm)</summary>\n\n###\n[`v10.20.0`](https://redirect.github.com/pnpm/pnpm/blob/HEAD/pnpm/CHANGELOG.md#10200)\n\n[Compare\nSource](https://redirect.github.com/pnpm/pnpm/compare/v10.19.0...v10.20.0)\n\n##### Minor Changes\n\n- Support `--all` option in `pnpm --help` to list all commands\n[#&#8203;8628](https://redirect.github.com/pnpm/pnpm/pull/8628).\n\n##### Patch Changes\n\n- When the `latest` version doesn't satisfy the maturity requirement\nconfigured by `minimumReleaseAge`, pick the highest version that is\nmature enough, even if it has a different major version\n[#&#8203;10100](https://redirect.github.com/pnpm/pnpm/issues/10100).\n- `create` command should not verify patch info.\n- Set `managePackageManagerVersions` to `false`, when switching to a\ndifferent version of pnpm CLI, in order to avoid subsequent switches\n[#&#8203;10063](https://redirect.github.com/pnpm/pnpm/issues/10063).\n\n</details>\n\n---\n\n### Configuration\n\n📅 **Schedule**: Branch creation - At any time (no schedule defined),\nAutomerge - At any time (no schedule defined).\n\n🚦 **Automerge**: Enabled.\n\n♻ **Rebasing**: Whenever PR is behind base branch, or you tick the\nrebase/retry checkbox.\n\n🔕 **Ignore**: Close this PR and you won't be reminded about this update\nagain.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/textlint/textlint).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiI0MS4xNTkuNCIsInVwZGF0ZWRJblZlciI6IjQxLjE1OS40IiwidGFyZ2V0QnJhbmNoIjoibWFzdGVyIiwibGFiZWxzIjpbImRlcGVuZGVuY2llcyJdfQ==-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
